function Navbar() {
    return ( 
        <div className='wrapper'>
            <ul>
                <li><img 
                    className="logo" 
                    src="https://cdn-icons-png.flaticon.com/512/6703/6703157.png" />
                </li>
                <li>
                    <a href={props.src}>{props.displayText}
                    </a>
                </li>
                <li><a href={props.src}><p>{props.displayText}</p></a></li>
                <li><img src={props.src} /></li>
            </ul>
        </div> );
}

export default Navbar;
